import React from "react";
import { useSelector } from "react-redux";

const Dashboard = () => {
  const user = useSelector((state) => state.details);

  return (
    <article>
      <h4>Dashboard</h4>
      <h5>{user.name}</h5>
      <h5>{user.email}</h5>
      <h5>Liked Courses:</h5>
      <ul>
        {user.liked.split("\n").map((course, index) => (
          <li key={index}>{course}</li>
        ))}
      </ul>
      <h5>Completed Courses:</h5>
      <ul>
        {user.completed.split("\n").map((course, index) => (
          <li key={index}>{course}</li>
        ))}
      </ul>
      <h5>Enrolled Courses:</h5>
      <ul>
        {user.enrolled.split("\n").map((course, index) => (
          <li key={index}>{course}</li>
        ))}
      </ul>
    </article>
  );
};

export default Dashboard;
